import styled from "styled-components"
import nangmanImg from "../assests/nangman.jpeg";


const HobbyContainer = styled.div`
  width: 25vw;
`

const TextContainer = styled.div`
  width: 100%;
  background: #4A86FF;
  border-radius: 1rem 1rem 0rem 0rem;
`

const HobbyText = styled.p`
  color: #FFF;
  text-align: center;
  font-family: Inter;
  font-size: 3vw;
  font-style: normal;
  font-weight: 700;
  line-height: normal;
`

const ImgContainer = styled.div`
  border-radius: 1rem;
  border: 1px solid #EBEDF8;
  background: #FFF;
`
export default function HobbyComponent({text, img}) {
  return (
    <HobbyContainer>
      <TextContainer>
        <HobbyText>{text}</HobbyText>
      </TextContainer>
      <ImgContainer>
        <Img src={img} alt="img" />
      </ImgContainer>
    </HobbyContainer>
  )
}
